import React from 'react';
import { NavLink } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import Header from '../Header/Header';
import './CustomForm.css'

const SignUp = () => {

    const { register, handleSubmit } = useForm('');
    const onSubmit = (data) =>{
        console.log(data);
    };

    return (
        <div>
            <Header />
            <div>
                <div className="titleForm">

                    <h1>Registrate</h1>

                </div>

                <main className="formContainer">
                    <form onSubmit={handleSubmit(onSubmit)} action="" className="formRegister">

                        <input className="input" type="text" name="nombre" placeholder="Nombre" {...register('nombre')}/>

                        <input className="input" type="text" name="apellido" placeholder="Apellido" {...register('apellido')}/>

                        <input className="input" type="email" name="email" placeholder="Email" {...register('email')}/>

                        <input className="input" type="password" name="contraseña" placeholder="Contraseña" {...register('')}/>

                        <div className="terminos">
                            <input type="checkbox" name="terminos" id="terminos" {...register('')}/>

                            <a href="#" > terminos y condiciones.</a>
                        </div>

                        <input className="submit" type="submit" value="Regístrate" disabled></input>
                    </form>
                    <div className="signUp">
                        <p>¿Ya eres miembro? <NavLink to='/SignIn'>inicia tu sesión</NavLink></p>

                        <p className="errorText">si se produce un error al completar un formulario aparecera un mensaje aqui.</p>
                    </div>
                </main>
            </div>
        </div>
    );
}

export default SignUp;
